import React from "react";
import "./header.css";


export default function HeaderOne(props){
    return(
        <header>

        <nav>
     <img
          className="top-image"
          src="/images/logo.png"
          alt="Logo do LIBRASPTB"
        />

        <ul className="top-menu">
        <li className="top-menu-item">{props.one}</li>
    
        <li className="top-menu-item">Contato</li>
        
        </ul>
        </nav>

        </header>
    )
}
